  "prompt": "A sophisticated, visually rich illustration symbolizing Singapore's grand strategy and geopolitical imperatives. The image shows a stylized map centered on Singapore with major trade routes marked through the Straits of Malacca and South China Sea. On the left, the U.S. and on the right, China, depicted with soft, abstract shapes to suggest great powers without confrontation. Singapore is portrayed as a glowing hub, with network lines extending to ASEAN nations, the EU, Japan, India, and the Middle East. Icons represent key sectors: a satellite for technology, a ship for trade, people figures for racial harmony, a shield for defense, and a balance scale for diplomacy and neutrality. The background is sleek and modern, with a professional color palette of deep blues, greys, and gold accents, suitable for a formal think-tank publication.",
