}

{
  "prompt": "A sophisticated, formal illustration representing Singapore's grand strategy and geopolitical imperatives. The design shows a stylized map with Singapore at the center, glowing as a strategic hub. Trade routes are highlighted through the Straits of Malacca and South China Sea. Abstract representations of the US and China are positioned on opposite sides, suggesting great powers without direct confrontation. Radiating lines connect Singapore to ASEAN, India, EU, Japan, and the Middle East. Key strategic themes are symbolized with clean icons: a satellite (technology), a cargo ship (trade), a diverse group of people (social cohesion), a shield (defense), and a balance scale (diplomacy). The overall palette uses deep navy, slate grey, and gold accents for a polished think-tank publication. The composition is modern, sleek, and suitable for a front-page government submission.",
